import * as React from 'react';
import { View, Text, Button } from 'react-native';
import {connect} from 'react-redux';
import {bindActionCreators} from 'redux';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

import {addDemo} from '../../store/actions';

const Tab = createBottomTabNavigator();

function FeedScreen(props) {
  console.log(props)
  const {demo, addDemo} = props
	return (
		<View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Home Screen,{demo}</Text>
      <Button title="count++" onPress={addDemo}></Button>
    </View>
	);
}
function MessagesScreen({ navigation }) {
	return (
		<View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
			<Text>Messages</Text>
			<Button onPress={() => navigation.navigate('Settings')} title='前往设置页' />
		</View>
	);
}

function HomeScreen() {
	return (
		<Tab.Navigator>
			<Tab.Screen name='Feed' demo={demo} addDemo={addDemo} component={FeedScreen} />
			<Tab.Screen name='Messages' component={MessagesScreen} />
		</Tab.Navigator>
	);
}
const mapDispatchToProps = {
    addDemo
}

export default connect(({demo}) => ({
    demo
}), mapDispatchToProps)(HomeScreen);
